DROP TABLE IF EXISTS `lic_dsls_feature_map`;
CREATE TABLE `lic_dsls_feature_map` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `feature` varchar(50) DEFAULT '',
  `trigram` varchar(255) DEFAULT '',
  `sequence` int(10) unsigned DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB COMMENT='Stores the Database of DSLS Features to RTM Features';

--
-- Table structure for table `lic_dsls_product_database`
--

CREATE TABLE IF NOT EXISTS `lic_dsls_product_database` (
  `branch` varchar(20) DEFAULT '',
  `trigram` varchar(20) DEFAULT '',
  `description` varchar(128) DEFAULT '',
  UNIQUE KEY `idx_branch_trigram` (`branch`,`trigram`)
) ENGINE=InnoDB COMMENT='Stores the Database of DSLS Features';

